import React from "react";
const cofeeIconWhite =  require("../../images/coffee.png")
const cofeeIconBlack =  require("../../images/cofeeBlack.png")

interface IColorProps {
    color: string
}

export const IconImage: React.FC<IColorProps> = (props) => {
    return (
         <div className={'icon-block'}>
            {props.color === 'black' && <img alt={'icon'} src={cofeeIconBlack}/>}
            {props.color === 'white' && <img alt={'icon'} src={cofeeIconWhite}/>}
        </div>
    )
};
